import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';

function Example(props) {
    const{closepop, Brand} = props;  
  return (
    <>
      <Modal show={true} onHide={closepop} backdrop={'static'} keyboard={false} centered={true} >
        <Modal.Header closeButton>
          <Modal.Title>heading</Modal.Title>
        </Modal.Header>
        <Modal.Body><h1 className='fs-4 text-align-center'>{Brand}</h1></Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={closepop}>
            Close
          </Button>
          <Button variant="primary" onClick={closepop}>
            Save Changes
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
}

export default Example;
